    false,nt"url": null,nt"notes": "This annual narrative report for the Brussels
    District of Mark Twain National Wildlife Refuge summarizes Refuge activities during
    the 1999 fiscal year.  Apple Creek WMA, Portage Island, the Calhoun Division, the
    Gilbert Lake Division, and the Batchtown Division are included.  The report begins
    with an introduction to the Refuge and a summary of the yearu2019s highlights and
    climatic conditions.  Information about monitoring and studies- including surveys
    and censuses- is provided next.  Habitat restoration and management projects are
    also covered; activities include water level management, moist soil management,
    mowing, farming, and vegetation control.  Fish and wildlife management is discussed
    next with emphasis on bird banding and nest structures.  Coordination activities,
    such as interagency coordination and private land activities, are outlined.  The
    resource protection section provides information about law enforcement, permits,
    and land acquisition support.  Information about public education and recreation
    is given.  Finally, Refuge planning and administration are discussed.",nt"owner_org":
